import { createReducer, on, Action } from '@ngrx/store';
import * as categoriesActions from '../actions/categories.actions';

export const featureKey = 'categories';

export interface Category {
  label: string;
  value: string;
  isSelected: boolean;
}

export interface CategoriesState {
  list: Category[];
  loading: boolean;
  error?: string | null;
}

const initialState: CategoriesState = {
  list: [],
  loading: false,
};

const categoriesReducer = createReducer(
  initialState,
  on(categoriesActions.fetchCategories, (state) => ({
    ...state,
    loading: true,
    error: null,
  })),
  on(categoriesActions.setCategories, (state, { categories }) => ({
    ...state,
    loading: false,
    list: categories.map((category, index) => ({
      ...category,
      isSelected: index === 0,
    })),
  })),
  on(categoriesActions.selectCategory, (state, { value }) => ({
    ...state,
    list: state.list.map((category) => ({
      ...category,
      isSelected: category.value === value,
    })),
  })),
  on(categoriesActions.setError, (state, { error }) => ({
    ...state,
    loading: true,
    error,
  }))
);

export function reducer(state: CategoriesState | undefined, action: Action) {
  return categoriesReducer(state, action);
}

