import { createReducer, on, Action } from '@ngrx/store';
import * as productsActions from '../actions/products.actions';

export const featureKey = 'products';

export interface Product {
  title: string;
  category: string;
  price: string;
  planId: number;
  imageUrl: string;
  altText: string;
  planContent: {
    text: string;
    label: string;
  }[];
  icon: string;
  currency: string;
  btnText: string;
  priceTerms: string;
  subPriceTerms: string;
  normalPrice: string;
}
export interface ProductsState {
  list: Product[];
  loading: boolean;
  error?: string | null;
}

const initialState: ProductsState = {
  list: [],
  loading: false,
};

const productsReducer = createReducer(
  initialState,
  on(productsActions.fetchProducts, (state) => ({
    ...state,
    loading: true,
    error: null,
  })),
  on(productsActions.setProducts, (state, { products }) => ({
    ...state,
    loading: false,
    list: products,
  })),
  on(productsActions.setError, (state, { error }) => ({
    ...state,
    loading: true,
    error,
  }))
);

export function reducer(state: ProductsState | undefined, action: Action) {
  return productsReducer(state, action);
}

