}
export interface ProductsState {
  list: Product[];
  loading: boolean;
  error?: string | null;
}

const initialState: ProductsState = {
  list: [],
  loading: false,
};

const productsReducer = createReducer(
  initialState,
  on(productsActions.fetchProducts, (state) => ({
    ...state,
    loading: true,
    error: null,
  })),
  on(productsActions.setProducts, (state, { products }) => ({
    ...state,
    loading: false,
    list: products,
  })),
  on(productsActions.setError, (state, { error }) => ({
    ...state,
    loading: true,
    error,
  }))
);

export function reducer(state: ProductsState | undefined, action: Action) {
  return productsReducer(state, action);
}

