import { iMainMenuItem, iTranslation } from '@lla/shared/util-library';

import { map } from 'rxjs/operators';
import { Observable } from 'rxjs';

import { config } from '../../app/config';

@Injectable({
  providedIn: 'root',
})
export class MenuService {
  constructor(private readonly httpService: HttpService) {}

  getMainMenu(domain = '', lang = ''): Observable<iMainMenuItem[]> {
    const endpoint = 'main_menu';
    const params = this.serializeParams({
      fields: '*.*.*',
      'filter[domain.domain_id][like]': domain,
    });
    return this.httpService
      .get(`${config.directusBaseUrl}/${endpoint}?${params}`)
      .pipe(map((response) => this.prepareMenu(response.data.data, lang)));
  }

  serializeParams(params: Record<string, string>): string {
    return new URLSearchParams(params).toString();
  }

  /**
   * prepares the menu list item
   * 1. get parent menu items (root menu items)
   * 2. gather all the sub menu item for all the root menu
   */
  prepareMenu(menuItems: iMainMenuItem[], lang: string): iMainMenuItem[] | [] {
    const mainMenu = [];
    const updatedMenu = [];
    // filter out the content for current language
    menuItems.forEach((menuItem) => {
      menuItem['translation'] = this.langFilter(menuItem, lang);
      updatedMenu.push(menuItem);
    });
    // get root menu items (parent menu)
    const rootMenu = this.getRootMenu(updatedMenu);
    // iterate each root menu and prepare the child menu items
    rootMenu.forEach((rootMenuItem) => {
      const subMenu = this.getSubMenuItem(updatedMenu, rootMenuItem);
      mainMenu.push({ ...rootMenuItem, children: subMenu });
    });
    return mainMenu || [];
  }
  /**
   * get all the menu items specific to parent menu
   * @param allMenuItems
   * @param parentMenu
   */
  getSubMenuItem(
    allMenuItems: iMainMenuItem[],
    parentMenu: iMainMenuItem
  ): iMainMenuItem[] | [] {
    return (
      allMenuItems.filter(
        (menuItem: iMainMenuItem) =>
          menuItem.parent && menuItem.parent['id'] === parentMenu.id
      ) || []
    );
  }
  /**
   * menu will have parent attribute as null if its a root menu
   * @param menuItems
   */
  getRootMenu(menuItems: iMainMenuItem[]): iMainMenuItem[] {
    return menuItems.filter((menu) => menu.parent === null);
  }

  /**
   * returning the content which matches the language code
   * @param menuItem
   * @param lang
   */
  langFilter(menuItem: iMainMenuItem, lang: string): iTranslation[] {
    return menuItem.translation.filter((menu) => menu.language_code === lang);
  }
}

