import { Observable } from 'rxjs';
import { map, startWith } from 'rxjs/operators';
import { iSelectOption } from '../../../interfaces/select-box';

type STATUS = 'success' | 'error' | '';

@Component({
  selector: 'lla-search-dropdown',
  templateUrl: './search-dropdown.component.html',
  styleUrls: ['./search-dropdown.component.css'],
})
export class SearchDropdownComponent implements OnChanges {
  /**
   * Inputs for select box option
   */
  myControl = new FormControl();
  filteredOptions$?: Observable<iSelectOption[]>;
  @Input() options: iSelectOption[] = [];
  @Input() placeholder? = '';
  @Input() status?: STATUS = '';
  @Input() message?: string = '';
  @Input() isDisabled?: boolean = false;
  @Output() dataSelected?: EventEmitter<iSelectOption> = new EventEmitter();
  ngOnChanges() {
    this.filteredOptions$ = this.myControl.valueChanges.pipe(
      startWith(''),
      map((label) => this.filter(this.options, label))
    );
  }

  private filter(options: iSelectOption[], label: string): iSelectOption[] {
    const filterValue = label.toLowerCase();
    const results = options.filter((optionsSelectable) =>
      optionsSelectable.label.toLowerCase().includes(filterValue)
    );
    return results.length
      ? results
      : [
          {
            value: 'No data',
            label: 'No data',
          },
        ];
  }
}

