  @Input() isDarkMode?: boolean = false;
  @Input() isLargeText?: boolean = false;
  @Output() dataSelected: EventEmitter<ISelectors> = new EventEmitter();
  columnNum = 3;
  constructor(private breakpointObserver: BreakpointObserver) {
    this.breakpointObserver
      .observe([
        Breakpoints.XSmall,
        Breakpoints.Small,
        Breakpoints.Medium,
        Breakpoints.Large,
        Breakpoints.XLarge,
        Breakpoints.HandsetLandscape,
      ])
      .subscribe((result) => {
        if (result.matches) {
          this.columnNum =
            result.breakpoints[Breakpoints.Small] ||
            result.breakpoints[Breakpoints.XSmall]
              ? 1
              : 3;
        }
      });
  }
  handleChanges(event: MatRadioChange): void {
    const data = this.options.find((item) => item.id === event.value);
    this.dataSelected.emit(data);
  }
}

