export class SelectorsComponent implements OnChanges, OnInit {
  @Input() options: ISelectors[] = [];
  @Input() isdisabled?: boolean = false;
  @Input() isDarkMode?: boolean = false;
  @Input() isLargeText?: boolean = false;
  @Output() dataSelected: EventEmitter<ISelectors> = new EventEmitter();
  columnSize = 0;

  constructor(private breakpointObserver: BreakpointObserver) {}

  ngOnChanges() {
    this.getDeviceBreakpoint();
  }

  ngOnInit() {
    this.getDeviceBreakpoint();
  }

  getDeviceBreakpoint(): void {
    this.breakpointObserver
      .observe([
        Breakpoints.XSmall,
        Breakpoints.Small,
        Breakpoints.Medium,
        Breakpoints.Large,
        Breakpoints.XLarge,
        Breakpoints.HandsetLandscape,
      ])
      /* 
      The columnsze will be 1 if, it is a small device
      The columnsze will be 1 if, it is a large device
      */
      .subscribe((breakpointState: BreakpointState) => {
        this.columnSize = this.isSmallDevice(breakpointState) ? 1 : 3;
      });
  }
  isSmallDevice(breakpointState: BreakpointState): boolean {
    if (breakpointState.matches) {
      return (
        breakpointState.breakpoints[Breakpoints.Small] ||
        breakpointState.breakpoints[Breakpoints.XSmall]
      );
    }
    return false;
  }

  handleChanges(event: MatRadioChange): void {
    const data = this.options.find((item) => item.id === event.value);
    this.dataSelected.emit(data);
  }
}

