})
export class ProductListingComponent implements OnInit {
  selectedProducts$ = this.store.select(selectProductsBySelectedCategory);

  constructor(
    private readonly store: Store<AppState>,
    public dialog: MatDialog
  ) {}

  ngOnInit(): void {
    this.store.dispatch(productsActions.fetchProducts());
  }

  onSelectProduct(id: number) {
    const dialogRef = this.dialog.open(WebformModalComponent, {
      width: '500px',
      data: id,
    });
    dialogRef.componentInstance.clickHandler.subscribe((res: boolean) => {
      if (res) {
        this.dialog.open(EcommerceWebformComponent, {
          width: '500px',
          data: true,
        });
      } else {
        this.dialog.open(EcommerceWebformComponent, {
          width: '500px',
          data: false,
        });
      }
    });
  }
}

