import { FormControl } from '@angular/forms';
import { Observable } from 'rxjs';
import { map, startWith } from 'rxjs/operators';
import { iSelectOption } from '../../../interfaces/select-box';

type STATUS = 'success' | 'error' | '';

@Component({
  selector: 'lla-search-dropdown',
  templateUrl: './search-dropdown.component.html',
  styleUrls: ['./search-dropdown.component.css'],
})
export class SearchDropdownComponent implements OnChanges {
  /**
   * Inputs for select box option
   */
  textLimit = 40;
  myControl = new FormControl();
  filteredOptions$?: Observable<iSelectOption[]>;
  @Input() options: iSelectOption[] = [];
  @Input() placeholder? = '';
  @Input() status?: STATUS = '';
  @Input() message?: string = '';
  @Input() isDisabled?: boolean = false;
  @Output() selectedOption: EventEmitter<iSelectOption> = new EventEmitter();

  ngOnChanges() {
    this.filteredOptions$ = this.myControl.valueChanges.pipe(
      startWith(''),
      map((label) => this.filter(this.options, label))
    );
  }

  filter(options: iSelectOption[], label: string): iSelectOption[] {
    const filterValue = label.toLowerCase();
    const results = options.filter((optionsSelectable) =>
      optionsSelectable.label.toLowerCase().includes(filterValue)
    );
    return results.length
      ? results
      : [
          {
            value: 'No Search Results',
            label: 'No Search Results',
          },
        ];
  }

  handleChanges(event: string): void {
    this.selectedOption.emit({
      value: event,
      label: event,
    });
  }
}

import {
  Component,
  EventEmitter,
  Input,
  OnChanges,
  OnInit,
  Output,
  ValueProvider,
} from '@angular/core';
import {
  BreakpointObserver,
  Breakpoints,
  BreakpointState,
} from '@angular/cdk/layout';
import { MatRadioChange } from '@angular/material/radio';

import { ISelectors } from '@lla/shared/util-library';

@Component({
  selector: 'lla-selectors',
  templateUrl: './selectors.component.html',
  styleUrls: ['./selectors.component.scss'],
})
export class SelectorsComponent implements OnChanges, OnInit {
  @Input() options: ISelectors[] = [];
  @Input() isdisabled?: boolean = false;
  @Input() isDarkMode?: boolean = false;
  @Input() isLargeText?: boolean = false;
  @Output() dataSelected: EventEmitter<ISelectors> = new EventEmitter();
  columnSize = 0;

  constructor(private breakpointObserver: BreakpointObserver) {}

  ngOnChanges() {
    this.getDeviceBreakpoint();
  }

  ngOnInit() {
    this.getDeviceBreakpoint();
  }

  getDeviceBreakpoint(): void {
    this.breakpointObserver
      .observe([
        Breakpoints.XSmall,
        Breakpoints.Small,
        Breakpoints.Medium,
        Breakpoints.Large,
        Breakpoints.XLarge,
        Breakpoints.HandsetLandscape,
      ])
      /* 
      The columnsze will be 1 if, it is a small device
      The columnsze will be 1 if, it is a large device
      */
      .subscribe((breakpointState: BreakpointState) => {
        this.columnSize = this.isSmallDevice(breakpointState) ? 1 : 3;
      });
  }
  isSmallDevice(breakpointState: BreakpointState): boolean {
    if (breakpointState.matches) {
      return (
        breakpointState.breakpoints[Breakpoints.Small] ||
        breakpointState.breakpoints[Breakpoints.XSmall]
      );
    }
    return false;
  }

  handleChanges(event: MatRadioChange): void {
    const data = this.options.find((item) => item.id === event.value);
    this.dataSelected.emit(data);
  }
}

