export default class StorydropdownComponent implements OnChanges {
  backgroundColor: string;
  television = 'Television + Telefion';
  internet = 'Internet + Television';
  options: iSelectOption[] = [
    { value: this.television, label: this.television },
    { value: this.internet, label: this.internet },
    { value: this.television, label: this.television },
  ];
  placeholder: string;
  status: string;
  message: string;
  isDisabled: boolean;
  currentValue = 3;
  updatedValue = 3;
  labelForOptions: string;

  ngOnChanges() {
    if (this.updatedValue > this.currentValue) {
      for (let i = this.currentValue; i < this.updatedValue; ) {
        i++;
        this.options.push({
          value: `value ${i}`,
          label: this.labelForOptions,
        });
      }
    } else if (this.updatedValue < this.currentValue) {
      for (let i = this.updatedValue; i < this.currentValue; i++) {
        this.options.pop();
      }
    }
    this.currentValue = this.updatedValue;
  }
}

